(3312, 'en', 'default', 'dff9e48815ee70045ecc9844adef0f15', 'The search for installed plugins will search for terms in their name, description, or author.', NULL, 'LINE', NULL, 0, '', '26eb73c3c9d1249e7a8eb21aaa1aca1e'),
(3313, 'en', 'default', '6c13edf4e89b56c3fe70bb814280fafb', 'The search results will be updated as you type.', NULL, 'LINE', NULL, 0, '', 'f80a59cb24e68ba6e40bf1bf9b0a7139'),
(3314, 'en', 'default', '50cafcf205163d1a714e927a582ad813', 'If you would like to see more plugins to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional plugins from the <a href="%s" target="_blank">WordPress Plugin Directory</a>. Plugins in the WordPress Plugin Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!', NULL, 'LINE', NULL, 0, '', '6aeea13e517700d06c2d4277b52d7387'),
(3315, 'en', 'default', '231cf4c70d866b616c21baddaeed0696', 'Troubleshooting', NULL, 'LINE', NULL, 0, '', 'f15a54e254bfb229acb9aa82aac27ebe'),
(3316, 'en', 'default', 'fcd99583341d36fed9a308df418b0501', 'Most of the time, plugins play nicely with the core of WordPress and with other plugins. Sometimes, though, a plugin&#8217;s code will get in the way of another plugin, causing compatibility issues. If your site starts doing strange things, this may be the problem. Try deactivating all your plugins and re-activating them in various combinations until you isolate which one(s) caused the issue.', NULL, 'LINE', NULL, 0, '', 'f0345a79c1b5429286734217a80c98ed'),
(3317, 'en', 'default', '37a24e605a3cda57698e531f125740bc', 'If something goes wrong with a plugin and you can&#8217;t use WordPress, delete or rename that file in the %s directory and it will be automatically deactivated.', NULL, 'LINE', NULL, 0, '', 'b9b8f473d110eff046e9836bde623ed6'),
