(3573, 'en', 'default', '60be57d14942b01e4d2bccff314615dc', 'Pages are similar to posts in that they have a title, body text, and associated metadata, but they are different in that they are not part of the chronological blog stream, kind of like permanent posts. Pages are not categorized or tagged, but can have a hierarchy. You can nest pages under other pages by making one the &#8220;Parent&#8221; of the other, creating a group of pages.', NULL, 'LINE', NULL, 0, '', '5bb48b4ca8537da5fe1c709d252a3dab'),
(3574, 'en', 'default', '87a4cd24ed88393b68b0c3eeaa9293ae', 'Managing Pages', NULL, 'LINE', NULL, 0, '', 'd37efe53d3cb0e5aec280a71039aaa15'),
(3575, 'en', 'default', '713db89d7ae9e244d012fb9dd9a53982', 'Managing pages is very similar to managing posts, and the screens can be customized in the same way.', NULL, 'LINE', NULL, 0, '', '5f160f3c0999b6f3c714064351523da7'),
(3576, 'en', 'default', '653290ee830033b040967d621084cb0f', 'You can also perform the same types of actions, including narrowing the list by using the filters, acting on a page using the action links that appear when you hover over a row, or using the Bulk Actions menu to edit the metadata for multiple pages at once.', NULL, 'LINE', NULL, 0, '', 'de3f01588a23e6930c757cb640155dfa'),
(3577, 'en', 'default', 'a37104a33f4c1676a4f4f137d99ffddf', '<a href="https://codex.wordpress.org/Pages_Screen" target="_blank">Documentation on Managing Pages</a>', NULL, 'LINE', NULL, 0, '', '39425acb07c5e1beb779bdba4cd13bdd'),
(3578, 'en', 'sitepress', '9e8cc5c6623ed5bee86d4ef0670060cd', 'How to translate', NULL, 'LINE', NULL, 0, '', '9b517694f741b818819ea6a29966a7d1'),
(3579, 'en', 'sitepress', '8eefbc2f167ba0b9f57da2ff3c28990e', 'hide this', NULL, 'LINE', NULL, 0, '', '15e3e9511988249006eeaff459f20c11'),
(3580, 'en', 'sitepress', '162291961d2fd556026ac768423da0c1', 'Are you sure you want to remove this button?', NULL, 'LINE', NULL, 0, '', '49ec857645c85a36a164ea7bb8c42e19'),
(3581, 'en', 'default', '2ccdc88567b5772738fcd40ac68e78f3', 'Page Attributes', NULL, 'LINE', NULL, 0, '', 'e27e76431fe6dabc5b5c54ed21d01d7b'),
(3582, 'en', 'default', '833956a760d996ae61ea8b385e9fb6f0', 'Custom Fields', NULL, 'LINE', NULL, 0, '', '8dd5fee1dad5778be5b20e7e86cc755d'),
(3583, 'en', 'default', '3ded626b75eebf44c0ca7a8587f84801', 'Creating a Page is very similar to creating a Post, and the screens can be customized in the same way using drag and drop, the Screen Options tab, and expanding/collapsing boxes as you choose. This screen also has the distraction-free writing space, available in both the Visual and Text modes via the Fullscreen buttons. The Page editor mostly works the same as the Post editor, but there are some Page-specific features in the Page Attributes box.', NULL, 'LINE', NULL, 0, '', '88d63d26a5d5ac5eef99a90931171ac9'),
(3584, 'en', 'default', 'aaf0eacd2910ab72ba554324323a55de', 'About Pages', NULL, 'LINE', NULL, 0, '', '81845170e7e36c133340d3cb786e68e8'),
(3585, 'en', 'default', 'e28ca7c1bc01a4499e095e6212a05bb1', '<a href="https://codex.wordpress.org/Pages_Add_New_Screen" target="_blank">Documentation on Adding New Pages</a>', NULL, 'LINE', NULL, 0, '', 'fa78e62bf694a7032e3ca4853b9fd5b3'),
(3586, 'en', 'default', 'c7933e9e384eab8cffd9517b26316eb9', '<a href="https://codex.wordpress.org/Pages_Screen#Editing_Individual_Pages" target="_blank">Documentation on Editing Pages</a>', NULL, 'LINE', NULL, 0, '', '126b0dd119c857ca1acb2e3d4b271054'),
(3587, 'en', 'default', 'e4d5552eac3895bbac77d104bb1ac888', 'You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.', NULL, 'LINE', NULL, 0, '', '63c19f99a08798af50e2a88aa8044305'),
(3588, 'en', 'default', '5860a8fa3ef1ea4cf6657c47ed83e90c', 'You can also embed media from many popular websites including Twitter, YouTube, Flickr and others by pasting the media URL on its own line into the content of your post/page. Please refer to the Codex to <a href="https://codex.wordpress.org/Embeds">learn more about embeds</a>.', NULL, 'LINE', NULL, 0, '', 'c214466f990742e589dfd33015c4c203'),
(3589, 'en', 'default', '168108e3b4fee6afab9dcf41920dec8a', 'Inserting Media', NULL, 'LINE', NULL, 0, '', 'bf22cc275e0dd347a2945311d7fdecac'),
(3590, 'en', 'default', '8f6225bd7662575ef84d375fec88dbd4', '<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.', NULL, 'LINE', NULL, 0, '', 'a7d363674bc0d711d6d160e3dbf13846'),
(3591, 'en', 'default', '597ef2b39aedb4e7f14e838eed92b8f7', '<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.', NULL, 'LINE', NULL, 0, '', '62319763264b08b9688c6a9f025316ba'),
(3592, 'en', 'default', 'dac04065919539b3bb81eb4152251ca4', '<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.', NULL, 'LINE', NULL, 0, '', 'f11c47af7f98788ea05b855c41902aa2'),
(3593, 'en', 'default', 'ebd830cf02aee290558e0d23ca121e94', '(no parent)', NULL, 'LINE', NULL, 0, '', 'f618dc5943fba71395959027726c0737'),
(3594, 'en', 'sitepress', '205bd9048f3e2aa143fe718178b710c3', 'Main Page (no parent)', NULL, 'LINE', NULL, 0, '', '7045fe597c8c4ba20b00e7183a788534'),
