(3686, 'en', 'default', 'e86c6f139efb799908dc085d7eef53ad', 'Press This', NULL, 'LINE', NULL, 0, '', '18541630a2cd7399da35feee874764b7'),
(3687, 'en', 'default', '1c766f50588f8caada9b5d7130ab1127', 'Press This is a bookmarklet that makes it easy to blog about something you come across on the web. You can use it to just grab a link, or to post an excerpt. Press This will even allow you to choose from images included on the page and use them in your post. Just drag the Press This link on this screen to your bookmarks bar in your browser, and you&#8217;ll be on your way to easier content creation. Clicking on it while on another website opens a popup window with all these options.', NULL, 'LINE', NULL, 0, '', 'fe3bd540eb74778a598238b253f74c86'),
(3688, 'en', 'default', 'c6448a2cdbc2074c41e2fe7249de1927', 'Categories and Tags Converter', NULL, 'LINE', NULL, 0, '', '40ef29ade9db93dd527862ec4b95c9e9'),
(3689, 'en', 'default', 'b0ca6078939acc19b65f7d3a980a50ff', 'Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.', NULL, 'LINE', NULL, 0, '', 'e90a19994fd4faf5fab54f4358835df1'),
(3690, 'en', 'default', '2f1a8ec3a8b277b002ea5dd3a9c166ec', 'The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.', NULL, 'LINE', NULL, 0, '', '73e9ba17e991f5898b5f2b0737c9ad4c'),
(3691, 'en', 'default', '564498f938fb724b583ebad77cfe028e', '<a href="https://codex.wordpress.org/Tools_Screen" target="_blank">Documentation on Tools</a>', NULL, 'LINE', NULL, 0, '', '3803641894e82a3bc63004a049535b0a'),
(3692, 'en', 'default', '06c51163e8813283ab725e4dfd467183', 'Press This is a little tool that lets you grab bits of the web and create new posts with ease.', NULL, 'LINE', NULL, 0, '', '950810cab5d955bbb097b8fbf9beaa3a'),
(3693, 'en', 'default', '21ca206e6734e57187cfc99edfa37548', 'Use Press This to clip text, images and videos from any web page. Then edit and add more straight from Press This before you save or publish it in a post on your site.', NULL, 'LINE', NULL, 0, '', '7d17dbbe8d42814301f7a0be3dd88d5c'),
(3694, 'en', 'default', '51efd8b10052581de553d62d6d45aa5c', 'Install Press This', NULL, 'LINE', NULL, 0, '', '5b702ab015426c9473939f27ffc8efd6'),
(3695, 'en', 'default', 'a67da649ec6dd243a001cf4e451ba5bd', 'Bookmarklet', NULL, 'LINE', NULL, 0, '', '8940620ef1f6607d183985520677250c'),
(3696, 'en', 'default', 'f6c5cca10233a4c683fbd2254d733386', 'Drag the bookmarklet below to your bookmarks bar. Then, when you&#8217;re on a page you want to share, simply &#8220;press&#8221; it.', NULL, 'LINE', NULL, 0, '', '627ef8cf75e0fe5c16d66ce6efc68e82'),
