(4894, 'en', 'default', '7c94be2dbcf6128955ea0b8f48cfaae8', 'Post via email settings allow you to send your WordPress install an email with the content of your post. You must set up a secret email account with POP3 access to use this, and any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret.', NULL, 'LINE', NULL, 0, '', 'a791ea41b523e28ddb53d96846b2ed9b'),
