(4910, 'en', 'default', '484621c16196969a956e3ebb139b6195', 'Post via email', NULL, 'LINE', NULL, 0, '', '2fbe958a0161b004d26a543a2bc87502'),
(4911, 'en', 'default', 'f29675aa2598fdc0c9a3e002b9a11bbc', 'To post to WordPress by email you must set up a secret email account with POP3 access. Any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret. Here are three random strings you could use: %1$s, %2$s, %3$s.', NULL, 'LINE', NULL, 0, '', 'e5d04cec1f79288076c30771c85f5983'),
