(5358, 'en', 'default', 'a8963a32af980e101c0b79e07d89a2d8', 'This screen is used for managing your installed themes. Aside from the default theme(s) included with your WordPress installation, themes are designed and developed by third parties.', NULL, 'LINE', NULL, 0, '', 'd1501beb0d1dc58db35529b27e34b75a'),
