(5362, 'en', 'default', '87bdfc55f8aa9863d65da5811111f65e', 'Click Customize for the current theme or Live Preview for any other theme to see a live preview', NULL, 'LINE', NULL, 0, '', '3ef04431778c77cdade70f366812a210'),
(5363, 'en', 'default', 'dd3258e965aab5f73100334a65e08673', 'The current theme is displayed highlighted as the first theme.', NULL, 'LINE', NULL, 0, '', '2c4414afb28b421c247aa0e4057bfd90'),
(5364, 'en', 'default', 'c5a4e15efc46e23f0bf0695ec14433b4', 'The search for installed themes will search for terms in their name, description, author, or tag.', NULL, 'LINE', NULL, 0, '', '1bc81ddaa9962129f39339b7ea4c77e4'),
(5365, 'en', 'default', '43878ef9d5df0ab3b4b82e9d9196258b', 'If you would like to see more themes to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional themes from the <a href="%s" target="_blank">WordPress Theme Directory</a>. Themes in the WordPress Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!', NULL, 'LINE', NULL, 0, '', 'bc545d7e52493237bbeb2c7657645a98'),
(5366, 'en', 'default', 'a1ea607a3097ae6f7ce0abbe9f8295c1', 'Adding Themes', NULL, 'LINE', NULL, 0, '', 'dae905075e3e10f0cb4402eebcb9267e'),
(5367, 'en', 'default', 'eb75d61c0d32edf7f02ac4b9245e9066', 'Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.', NULL, 'LINE', NULL, 0, '', '6f6504bc3b2a415851941dc76f520261'),
(5368, 'en', 'default', '662d392e9c4877e172207a5baea4a8d8', 'The theme being previewed is fully interactive &mdash; navigate to different pages to see how the theme handles posts, archives, and other page templates. The settings may differ depending on what theme features the theme being previewed supports. To accept the new settings and activate the theme all in one step, click the Save &amp; Activate button above the menu.', NULL, 'LINE', NULL, 0, '', 'fb6282bae5e72544440a25f34d8a4a75'),
(5369, 'en', 'default', '91015d74131523d75c8ee1d82db9e132', 'When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.', NULL, 'LINE', NULL, 0, '', 'ec0c3d224b684a115d955d14d78a3c2b'),
(5370, 'en', 'default', 'bd60752162e6b0c96335eecbaf7869fb', 'Previewing and Customizing', NULL, 'LINE', NULL, 0, '', '5f2625cca7abdd0876d0bb689a764079'),
