"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 13 Oct 2016 04:00:38 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1675:"\n		        C''est quoi le Coding Standard Tool de WordPress ? Pourquoi s''en servir ? Et surtout comment l''automatiser dans notre éditeur ou IDE ? Suivez le guide !Accédez à l''article original : Le WordPress coding standard tool dans votre éditeur ou IDE.\n    Voici le début du contenu : Les règles de &laquo;&nbsp;codage&nbsp;&raquo; aident à garder le code lisible et maintenable pour les développeurs. Elles sont d&rsquo;autant plus nécessaires pour les projets Open Source où de nombreux développeurs, de tout horizon, travaillent à l&rsquo;amélioration et à l&rsquo;évolution de l&rsquo;application. Ceci s&rsquo;applique donc naturellement à WordPress et à sa communauté. Pour en savoir plus, suivez le guide qui en parle, à savoir le Codex. Ah, mais c&rsquo;est bien beau ton petit lien, mais je me vois mal tout retenir et faire un sans faute durant mes développements. C&rsquo;est vrai, ceux qui se font cette remarque ont raison. Les règles de codage sont nombreuses, très nombreuses. Personnellement j&rsquo;ai fais le choix de les comprendre, de les adopter puis d&rsquo;utiliser un outil qui contrôle et me corrige si besoin est. Oui oui, c&rsquo;est très pratique et surtout ça se fait automatiquement. C&rsquo;est ce que l&rsquo;on appelle le &laquo;&nbsp;Coding standard tool&nbsp;&raquo;. C&rsquo;est quoi un Coding Standard Tool ? Ce genre d&rsquo;outil qui valide et corrige votre code selon des standards prédéfinis (en l’occurrence WordPress dans notre cas de figure), vous pouvez en trouver énormément. Chaque IDE en propose plus ou moins nativement, d&rsquo;autres proposent un seul et même outil pour tous [...]		        ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:6:"SeoMix";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2022:"<div><img class="webfeedsFeaturedVisual" src="http://www.seomix.fr/wp-content/uploads/2016/10/37588777.jpg" /></div>C''est quoi le Coding Standard Tool de WordPress ? Pourquoi s''en servir ? Et surtout comment l''automatiser dans notre éditeur ou IDE ? Suivez le guide !<p><strong>Accédez à l''article original :</strong> <a href="http://www.seomix.fr/wordpress-coding-standard-ide-editeur/">Le WordPress coding standard tool dans votre éditeur ou IDE</a>.</p>\n    <p><strong>Voici le début du contenu :</strong> <p>Les règles de &laquo;&nbsp;codage&nbsp;&raquo; aident à garder le code lisible et maintenable pour les développeurs. Elles sont d&rsquo;autant plus nécessaires pour les projets Open Source où de nombreux développeurs, de tout horizon, travaillent à l&rsquo;amélioration et à l&rsquo;évolution de l&rsquo;application. Ceci s&rsquo;applique donc naturellement à WordPress et à sa communauté. Pour en savoir plus, suivez le guide qui en parle, à savoir le Codex.</p> <p>Ah, mais c&rsquo;est bien beau ton petit lien, mais je me vois mal tout retenir et faire un sans faute durant mes développements.</p> <p>C&rsquo;est vrai, ceux qui se font cette remarque ont raison. Les règles de codage sont nombreuses, très nombreuses. Personnellement j&rsquo;ai fais le choix de les comprendre, de les adopter puis d&rsquo;utiliser un outil qui contrôle et me corrige si besoin est. Oui oui, c&rsquo;est très pratique et surtout ça se fait automatiquement. C&rsquo;est ce que l&rsquo;on appelle le &laquo;&nbsp;Coding standard tool&nbsp;&raquo;.</p> <h2>C&rsquo;est quoi un Coding Standard Tool ?</h2> <p>Ce genre d&rsquo;outil qui valide et corrige votre code selon des standards prédéfinis (en l’occurrence WordPress dans notre cas de figure), vous pouvez en trouver énormément. Chaque IDE en propose plus ou moins nativement, d&rsquo;autres proposent un seul et même outil pour tous [...]</p><hr /><img src="http://feeds.feedburner.com/~r/wpfr/~4/JJG2KAiX4QU" height="1" width="1" alt=""/>";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:42:"http://rssnamespace.org/feedburner/ext/1.0";a:1:{s:8:"origLink";a:1:{i:0;a:5:{s:4:"data";s:59:"http://www.seomix.fr/wordpress-coding-standard-ide-editeur/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:84:"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    ";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:4:{s:0:"";a:5:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:49:"Quel est le meilleur thème ThemeForest de 2016 ?";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:51:"http://feedproxy.google.com/~r/wpfr/~3/1AcQNbF6oUs/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:41:"https://wpmarmite.com/battle-themeforest/";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 11 Oct 2016 13:44:55 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:395:"\n		        \nDepuis le début de l’été, je teste un à un les thèmes les plus populaires de ThemeForest pour voir lequel est le plus prometteur. Mais je préfère vous l’annoncer de...\nQuel est le mei